import React from "react";
import "./post.css";

export default function Post() {
    return (
        <article class="blog">
            <figure class="blog__header" aria-hidden="true">
                <a href="#" style="background-image:url(./img02.jepg);"></a>
            </figure>
            <div class="blog__body">
                <span class="blog__cate"></span>
                <div class="blog__title"></div>
                <div class="blog__desc"></div>
                <div class="blog__info">
                    <span class="author">
                        <a href="#"></a>
                    </span>
                    <span class="date"></span>
                </div>
            </div>
        </article>
    );
}
